import React from 'react';
import './App.css';


const Story = ({ story }) => {
    const {
      title,
      url,
      author,
      num_comments,
      points,
    } = story;

    return (
      <div className="story">
        <span>
          <a href={url}>{title}</a>
        </span>
        <span>TESSTT {author}</span>
        <span>{num_comments}</span>
        <span>{points}</span>
      </div>
    );
  }

const App = ({ stories }) =>
  <div className="app">
     <div className="stories">
    {(stories || []).map(story =>

         <>{Story({story})}</>

    )}
  </div>
  </div>

export default App;
